import "./post.css";
import gambar from "../assets/image/logo.png"
import TimeAgo from "react-timeago"
import indonesiaStrings from "react-timeago/lib/language-strings/id"
import buildFormatter from 'react-timeago/lib/formatters/buildFormatter'

const Post = (props) => {
  const {id,title,stories}=props.data;
  const formatter = buildFormatter(indonesiaStrings)
  return (
    <div className="post">
      <img
        className="postImg"
        src={gambar}
        alt=""
      />
      <div className="postInfo">
        <span className="postTitle">
          <div className="link">
            {title}
          </div>
        </span>
        <hr />
        <span className="postDate">
          <TimeAgo date='Nov 25, 2021' formatter={formatter} />
          </span>
      </div>
      <p className="postDesc">
        {stories}
      </p>
    </div>
  );
}

export default Post;
